import React from 'react';
import IconSVG from '../../assets/icons/icons.svg';

const Icon = ({name, className}) => {
    return (
        <svg width="300" height="300"
             viewBox="0 0 180 180">
            <use  xlinkHref={`${IconSVG}#${name}`} className={className}/>
        </svg>
    );
};

export default Icon;
